パックス 200番 台所用石けん 詰替用2300ml<br>ブランド：パックス<br>販売・製造元：太陽油脂<br><br>精製された植物油(ヤシ油)を原料にしてつくった環境にやさしいキッチン用洗剤(エコ洗剤)です。手肌におだやかなので、直接スポンジや荒織りの布につけてお使いください。合成界面活性剤や香料等の合成化学物質は無添加の液体純石けん液です。詰替え用。 <br>用途食器・調理器具用 液性弱アルカリ性 成分純石けん分(20% 脂肪酸カリウム) 使用量の目安水1Lに対し7.5ml(料理用小さじ一杯は約5ml) 使用上の注意●万一飲み込んだ場合は、水を飲ませるなど処置をしてください。●お肌に合わない場合はご使用をおやめください。●他の製品とまぜないでください。●白濁したり、臭いが出ることがありますが成分は変化しません。 <br>日用品／キッチン用品／台所用洗剤／環境洗剤(エコ洗剤) キッチン用<br>JANコード： 4904735053323<br><br>CS：4<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
