ウレタンスポンジをネットでつつんだスポンジ。キズをつけずに強力洗浄。アルミネットタイプ。<br><br><br>抗菌ネットスポンジたわし(アルミ蒸着ネット)<br>アルミ蒸着ネット使用の抗菌ネットスポンジたわしです。グラス・ホーロー・フッ素加工にも、キズをつけずにスッキリとこびりつき汚れを落とします。 使用上の注意●初めての使用の前には水で洗う。<br>●食器、調理機器などの台所用品以外の物には使用しない。<br>●軟質プラスチック、漆器など特にキズつきやすい物には、あらかじめ目立たない部分でテストする。<br>●包丁などを洗うと刃でネットが切れることがある。<br>●使用後はすすいで水を切る。<br>●塩素系漂白剤は使用しない。<br>●煮沸消毒はしない。<br>●火のそばには近づけない。<br>●廃棄時はプラスチックゴミとして市町村の定める方法に従って処理する。 製品仕様●材質：アルミ蒸着ポリエステル(ネット)、抗菌ウレタンスポンジ(無機系抗菌剤使用)●使用温度：90度以下 <br>原産国：日本<br><br> お問い合わせ先：住友スリーエム株式会社コンシューマー製品事業部：03-3709-8624  <br>販売_製造元： 住友スリーエム<br>ブランド：スコッチ・ブライト<br>JAN：4519001044532<br>CS：20<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
