フィニッシュ ジェル 400ml<br>ブランド：フィニッシュ<br>販売・製造元：アース製薬<br><br>さっと溶けてスッキリ洗浄、食器から庫内までピカピカに仕上げる食器洗い機専用洗剤です。<br>酵素の青い粒がしつこい汚れに浸透、分解。<br>濃縮ジェルが食器をやさしくきれいに洗い上げます。<br>各メーカーの食器洗い乾燥機に使えます。<br> <br><br><br>使用方法<br>キャップを開けてボトルを軽く押し、いつも洗剤を入れている場所に適量のジェルを流しいれて下さい(使用量の目安を参考にして下さい)。<br>使用後はすぐにキャップがカチッ音がするまで閉めて下さい。<br>*機種のサイズに合わせてご使用ください。<br>4-5人用/小さじ1杯(5ml)、6-8人用/小さじ2杯(10ml)、8-12人用/小さじ3杯(15ml)*汚れの度合いに応じて、最大1.5倍の量範囲以内でご使用下さい。<br> 使用前の確認・お手持ちの食器洗い乾燥機で指定された使用手順をきちんと守って下さい。<br>・グラタンの焼きつき、茶碗蒸し、口紅汚れなどの頑固な汚れはあらかじめ落としてから洗浄して下さい。<br>・残菜フィルターの残菜は、使用のつど取り除いて下さい。<br>*使えない食器*漆器、アルミ食器、クリスタルグラス、カットグラス、銀食器、金線、銀線、上絵付の食器、その他お手持ちの食器洗い乾燥機の取扱説明書にて禁止されているもの。<br> <br><br>使用上の注意<br>・子供の手の届く所に置かない。<br>・目に入ったり、皮ふについたりしないようにする。<br>・使用後は手を水でよく洗い流す。<br>・荒れ性の方は炊事用手袋を使う。<br>・用途以外に使用しない。<br> 応急処置・飲みこんだ時には、吐かずに水または牛乳を飲む。<br>・目に入ったり、皮ふについたりした時は、こすらずすぐに水でよく洗い流す。<br>・異常がある時は、医師に相談する。<br> 品質表示●用途：食器・調理用具用(食器洗い乾燥機用)●液性：中性●成分：界面活性剤(0.2%ポリオキシアルキレンアルキルエーテル)、水軟化剤(クエン酸塩)、増粘剤、酵素<br> 原産国日本 <br>日用品／キッチン用品／台所用洗剤／洗剤 食器洗い機専用(食洗機用洗剤)<br>JANコード： 4906156500271<br><br>CS：24<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
