抗菌ウレタンスポンジとナイロン不織布（特殊クリーニング粒子つき）の貼り合わせ。特殊クリーニング粒子で、しつこい湯あかもすっきり。抗菌加工でヌメリもなくいつも清潔。<br><br>日用品(\)掃除用品(\)お風呂用 掃除用品<br>スコッチ・ブライト バスシャイン 抗菌スポンジ M型3層<br>落ちにくい湯アカもラクに落ちる、キズをつけにくい特殊研磨粒子のスポンジです。M型の先端が、風呂フタの凹みや角にピタっとはまる。特殊研磨粒子はポリ・ホーロー・ステンレスなどより柔らかいので、ほとんどの材質にキズをつけにくく、安心してお使い頂けます。スポンジについた菌の増殖を抑制し、黒ずみ、悪臭、ヌメリを防ぎます。水切れをよくするロープつき。収納にも便利です。 使用上の注意●浴室小物、浴そう、浴室の床や壁などの洗浄に使用する。<br>●必ず水でぬらしてから使用する。<br>●プラスチックなど特にキズつきやすい物や光沢のあるステンレス浴そうなどにはあらかじめ目立たない部分でテストする。<br>●使用後はよくすすぎ、水を切る。<br>●製品が劣化するので、塩素系漂白剤は使用しない。<br>●観賞魚等の水そうなど浴室以外の洗浄には使用しない。<br>●火のそばには近づけない。<br>●廃棄時はプラスチックゴミとして市町村の定める方法に従って処理する。 製品仕様●材質：ナイロン不織布(研磨粒子を含まず)、抗菌ウレタンスポンジ(無機系抗菌剤使用)●使用温度：90度以下 <br>原産国：日本<br><br> お問い合わせ先：住友スリーエム株式会社コンシューマー製品事業部：03-3709-8624  <br>販売_製造元： 住友スリーエム<br>ブランド：スコッチ・ブライト<br>JAN：4547452787661<br>CS：30<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
